package file;

import java.io.ByteArrayOutputStream;
import java.io.File;
import java.io.FileInputStream;
import java.io.FileOutputStream;

import org.junit.Test;

public class FIleTest {

	@Test
	public void test() throws Exception{
		
		File file = new File("d:/bb.pdf");
		FileInputStream fis = new FileInputStream(file);
		ByteArrayOutputStream baos = new ByteArrayOutputStream();
		byte[] b = new byte[1024];
		int len = 0;
		while((len = fis.read(b))>-1){
			baos.write(b,0,len);
		}
		fis.close();
		byte[] result = baos.toByteArray();
		byte[] compress = GZipUtils.compress(result);
		String encodeToString = Base64Encoding.encodeToString(compress);
		System.out.println(encodeToString);
	}
	
	
	@Test
	public void test2() throws Exception{
		
		String s = "";

		byte[] decode = Base64Encoding.decode(s);
		byte[] decompress = GZipUtils.decompress(decode);
		FileOutputStream fos = new FileOutputStream("d:/bb.pdf");
		fos.write(decompress);
		fos.close();
	}
}
